// src/pages/Home.js
import React, { useEffect, useState } from "react";
import RegularHours from "../components/RegularHours";
import SpecialHours from "../components/SpecialHours";
import { regularHours, specialHours as defaultSpecialHours } from "../data";

const Home = () => {
  const [specialHours, setSpecialHours] = useState([]);

  useEffect(() => {
    const storedSpecialHours = JSON.parse(localStorage.getItem("specialHours")) || [];
    setSpecialHours([...defaultSpecialHours, ...storedSpecialHours]);
  }, []);

  return (
    <div>
      <RegularHours hours={regularHours} />
      <SpecialHours hours={specialHours} />
    </div>
  );
};

export default Home;
